WITH root_vehicle_tag AS (

SELECT
  sc.waybill_no,
  -- sc.bag_no,
  sc.vehicle_tag_no,
  sc.operation_branch_name mh_sending,
  sc.next_location_name next_location,
  DATE(sc.record_time, 'Asia/Jakarta') AS sending_time,
  CONCAT(sc.vehicle_tag_no,' ','-',' ',sc.waybill_no) AS vm_awb_concat,
  rd1.option_name AS operation_type,


FROM `datawarehouse_idexp.waybill_waybill_line` sc
  LEFT JOIN `datawarehouse_idexp.system_option` rd1 ON sc.operation_type = rd1.option_value AND rd1.type_option = 'operationType'

WHERE DATE(sc.record_time,'Asia/Jakarta') BETWEEN '2023-08-01' AND CURRENT_DATE() -->= (DATE(DATE_ADD(CURRENT_DATE(), INTERVAL -62 DAY)))
AND sc.operation_type = '04'
