-- QUALIFY ROW_NUMBER() OVER (PARTITION BY sc.waybill_no ORDER BY sc.record_time DESC)=1
),

waybill_data AS (

  SELECT
  a.*,
  DATE(ww.pod_record_time,'Asia/Jakarta') pod_date,
  ww.pod_branch_name,
  DATETIME(ww.update_time,'Asia/Jakarta') update_time_ww,
  CASE 
      WHEN DATE(ww.pod_record_time,'Asia/Jakarta') = sending_time THEN 1 ELSE 0 END AS pod_sameday_from_sending,
  CASE 
      WHEN DATE(ww.pod_record_time,'Asia/Jakarta') <> sending_time THEN 1 ELSE 0 END AS pod_diff_from_sending,
  CASE
      WHEN a.waybill_no IS NOT NULL THEN 1 ELSE 0 END AS waybill_alias,
  CASE
      WHEN ww.pod_record_time IS NULL AND ww.return_flag = '1' THEN 1 ELSE 0 END AS return_awb,
  CASE
      WHEN ww.pod_record_time IS NULL AND ww.return_flag = '0' THEN 1 ELSE 0 END AS not_pod,

  FROM root_vehicle_tag a
  LEFT JOIN `datawarehouse_idexp.waybill_waybill` ww ON a.waybill_no = ww.waybill_no
)

----------------------
-- SELECT * FROM waybill_data

-- WHERE vehicle_tag_no = 'VM1800080589'
----------------------------
SELECT 

vehicle_tag_no,
mh_sending,
FORMAT_DATE("%b %Y", DATE(sending_time)) AS month,
SUM(waybill_alias) total_awb,
SUM(pod_sameday_from_sending) pod_sameday_with_sending,
SUM(pod_diff_from_sending) pod_diff_day_sending,
SUM(return_awb) total_return_awb,
SUM(not_pod) total_not_pod,

FROM (
SELECT * FROM waybill_data
)

GROUP BY 1,2,3
